import React from 'react';

class StockSelector extends React.Component {
  constructor(props) {
    super(props)
    this.state = {
      nome: '',
      codigo: '',
      precoCompra: 0,
    }
  }
  render() {
    const { stocks } = this.props;
    console.log(stocks)
    return(
      <div>
        <table>
          <tbody>
            <tr>
              <th>Nome</th>
              <th>Código</th>
              <th>Preço</th>
            </tr>
          </tbody>
          <tbody>
            {stocks.map((e) =>
              <tr key={e.codigoADR}>
                <td>{e.empresa}</td>
                <td>{e.codigoADR}</td>
                <td>{e.preco}</td>
              </tr>
              )}
          </tbody>
        </table>
      </div>
    )
  }
}

export default StockSelector;
